  }
    customtdallClass() {
        return 'custom-tdall-class';
    }
  isExpandableRow() {
    return true;
  }

  expandComponent(row) {
    return (
      <BSTable data={ row.expand } />
    );
  }

  priceFormatter(cell, row) {   // String example
    return `<p>hello</p> ${cell}`;
  }
  render() {
    const options = {
      expandRowBgColor: '#fff',
      defaultSortName: 'name',
    };
    const { datas } = this.state;
    return (
      <BootstrapTable data={ datas.rows } tableBodyClass='my-custom'
        options={ options }
        search
        pagination
        expandableRow={ this.isExpandableRow }
        expandComponent={ this.expandComponent } trClassName={ this.trClassFormat }>
        <TableHeaderColumn dataField='name' isKey={ true } width="150" dataSort={ true } className={ this.customtdallClass } dataFormat={this.priceFormatter}>Callers</TableHeaderColumn>
